import Chat from '../components/Chat/chat.component.jsx'
import React, {useState} from 'react';
import ChatButton from '../components/Chatbutton/chat-button.component'
const ChatPage = () => {
    const [hidden, setHidden] = useState(true)


    return (
        <div style={{marginTop: '100px'}}>
            <button type='button' onClick={() => setHidden(!hidden)}>Chat</button>
            {   !hidden ?
                <Chat />
            :null }
            <ChatButton/>
        </div>
    )
}

export default ChatPage;
